INSERT INTO `thuonghieu` VALUES ('TH0001','Maybelline','Mỹ','Với lịch sử trăm năm hình thành và phát triển thương hiệu, Maybelline Newyork sở hữu danh sách các đại sứ thương hiệu vào loại đình đám nhất trên thế giới với những cái tên: Josie Maran, Miranda Kerr, Sarah Michelle Gellar, Melina Kanakaredes, Chương Tử Di, Siti Nurhaliza, Fasha Sandha, Sheetal Mallar, Julia Stegner, Jessica White và Kristin Davis.\nCác dòng sản phẩm của Maybelline mang sứ mệnh đem những công thức khoa học tiến tiến nhất, mang tính cách mạng trong lĩnh vực làm đẹp giúp cho người phụ nữ thêm tự tin với vẻ ngoài sắc sảo. Nên thương hiệu này luôn cho ra xu hướng trang điểm từ trên sàn cat-walk đến phong cách đường phố, tạo cho phụ nữ một cá tính, khai phá cái mới, không quá phô trương để tạo dấu ấn riêng cho chính mình. Mọi phụ nữ đều có quyền đẹp hơn và sắc sảo hơn mỗi ngày.\nMột thương hiệu hiệu khá nổi tiếng với những sản phẩm trang điểm đình đám như mascara, kem nền, phấn nước, phấn phủ, má hồng, ... đã đạt một sự thành công nhất định trên thị trường làm đẹp Âu Mỹ, vậy Maybelline đã phát triển như thế nào tại Việt Nam?\nTừ năm 2007, Maybelline chính thức xuất hiện trên thị trường Việt Nam và nắm giữ vị trí số 1 ở dòng sản phẩm mascara và các sản phẩm cơ bản dành cho mặt và môi. Sau vài năm phát triển, nhãn hàng Mỹ Maybelline đã phát triển vững mạnh, đầy đủ nhất của một bộ trang điểm chuyên nghiệp được đông đảo người tiêu dùng Việt Nam yêu thích, bởi nhờ vào chất lượng vượt trội và giá cực kỳ bình dân.'),('TH0002','L\'oreal ','Pháp','Thương hiệu L\'Oreal đang ngày càng phát triển với hàng ngàn chi nhánh lớn nhỏ trên khắp thế giới. Các dòng sản phẩm của hãng vô cùng đa dạng từ chăm sóc tóc, trang điểm và chăm sóc da… Mỹ phẩm thương hiệu L\'Oreal luôn được các diễn viên, ca sĩ, người mẫu nổi tiếng sử dụng và được các beauty blogger đánh giá cao về chất lượng sản phẩm.\nGiữa năm 2017, L\'Oreal Paris chính thức mở chi nhánh tại Việt Nam và mang đến khách hàng nhiều mẫu sản phẩm đáp ứng nhu cầu làm đẹp của cả phụ nữ và nam giới.'),('TH0003','Senka','Nhật Bản','Các chị em là tín đồ của mỹ phẩm có xuất xứ từ Nhật Bản thì chắc hẳn sẽ chẳng lạ lẫm gì với thương hiệu nổi tiếng Senka, đây là một nhãn hiệu mà tên tuổi của nó đã vượt ra ngoài phạm vi của Nhật Bản và đến với tay người tiêu dùng trên khắp thế giới. Minh chứng cho những điều này đó chính là độ phủ của các sản phẩm ngày càng lan rộng và kèm với đó là sự yêu thích của khách hàng trên khắp thế giới. Một ưu điểm cần chú ý về thương hiệu này nữa đó chính là việc đầu tư về chất lượng luôn được chú trọng nhưng các sản phẩm lại có mức giá bình dân phù hợp với mọi đối tượng người dùng. Đó chính là một thế mạnh để thương hiệu nổi tiếng này có thể cạnh tranh sòng phẳng với các ông lớn khác trong làng mỹ phẩm thế giới nói chung và Nhật Bản nói riêng.\nĐược ra đời năm 2002 thuộc tập đoàn Shiseido Group, nhưng nhờ cải tiến sản phẩm không ngừng cho nên Senka đã phát triển vượt bậc và trở thành một trong những cái tên hàng đầu về phương diện mỹ phẩm tại Nhật Bản. Nói đến senka là những người yêu làm đẹp sẽ nghĩ ngay tới những sản phẩm thế mạnh của thương hiệu này đó chính là các sản phẩm tẩy trang, sữa rửa mặt hay các sản phẩm kem chống nắng hàng đầu trên thị trường hiện nay. Có nhiều lí do để giải thích cho sự thành công của Senka và cũng không quá khó để liệt kê những điểm nổi bật để trả lời cho câu hỏi Mỹ phẩm của SENKA có gì hot:\n– Chất lượng sản phẩm được đảm bảo hàng đầu\n– Giá cả bình dân và có nguồn gốc xuất xứ tại Nhật.\n– Tập trung mạnh vào một vài dòng sản phẩm chuyên và không hề sản xuất đại trà như các thương hiệu khác.'),('TH0004','SILKYGIRL','Singapore và Malaysia','Silkygirl ra mắt năm 2005, được phát triển từ tập đoàn AGC có nguồn gốc từ Singapore. Với 15 năm góp mặt trên thị trường mỹ phẩm Châu Á, đứa con cưng của tập đoàn AGC là nhiều năm liền giành được thành tích là thương hiệu mỹ phẩm best seller tại Singapore. \nLấy cảm hứng từ sự trẻ trung của đô thị Singapore và Malaysia, sản phẩm của Silkygirl mang những màu sắc mới lạ và ấn tượng. Hiện tại, Silkygirl đã có mặt tại hơn 5.000 quầy mỹ phẩm tại các nước Châu Á như Singapore, Malaysia, Indonesia,... và Việt Nam. Bên cạnh đó còn có mặt tại các nước Tây Âu như Đức, Tây Ban Nha và Mỹ. Có mặt tại Việt Nam gần 3 năm, Silkygirl thu hút sự chú ý của nhiều chị em phát đẹp bởi sự mới lạ và ấn tượng của em ý.'),('TH0005','Cetaphil','Canada','Cetaphil là thương hiệu nổi tiếng chăm sóc làn da nhạy cảm một cách tốt nhất mà không một sản phẩm nào có thể so sánh được. Thương hiệu Cetaphil thuộc tập đoàn Galderma được sản xuất tại Canada. Những dòng sản phẩm của thương hiệu Cetaphil được các chuyên gia da liễu hàng đầu khuyên dùng vì sản phẩm có thành phần dịu nhẹ, an toàn, chất lượng, không chứa xà phòng và độ Ph tự nhiên phù hợp với  da giúp duy trì và bảo vệ làn da mỏng manh như da em bé. Ngoài ra sản phẩm cũng dành cho da thường, hỗn hợp, da dầu nhẹ, để có được làn da tươi sáng và đầy sức sống.\nThương hiệu Cetaphil đã có mặt tại thị trường Vệt Nam hơn 10 năm nay, nhưng chỉ sau 3 năm thành lập Cetaphil đã trở thành sản phẩm chăm sóc da có danh sách bán chạy nhất so với các dòng mỹ phẩm khác. Điều này đã khẳng định được thương hiệu về độ an toàn và uy tín cũng như chất lượng của khách hàng đối với sản phẩm. Cetaphil là dòng mỹ phẩm được các chuyên da khoa da liễu chững minh là thích hợp với từng loại da, ngay cả làn da nhạy cảm nhất.\nThương hiệu Cetaphil chuyên về các dòng sản phẩm như Sửa rửa mặt, kem dưỡng ẩm, kem chống nắng, sữ tắm cho bé… Sản phẩm với ưu điểm là không mùi, dịu nhẹ là phương phấp tốt nhất cho mọi loại da.'),('TH0006','SOME BY MI','Hàn Quốc','Some By Mi là một thương hiệu mỹ phẩm nội địa nổi tiếng Hàn Quốc, hãng luôn nằm trong danh sách những thương hiệu mỹ phẩm được yêu thích nhất tại Hàn hiện nay. Hiện tại, Some By Mi có trụ sở tại Jinsung Bldg 401, Hangang-ro Road 24-1, Dongdaemun-gu, Seoul, Hàn Quốc. Some By Mi là cụm từ ghép của từ something và by a miracle, tên thương hiệu có nghĩa là một \"phép màu kì diệu\" sẽ giúp làn da của bạn hoàn hảo hơn.'),('TH0007','Simple','Anh','Simple là một thương hiệu mỹ phẩm bình dân đến từ Vương quốc Anh, thuộc sỡ hữu của tập đoàn Unilever nổi tiếng toàn cầu.\n\"Dịu nhẹ và lành tính\" là 2 tiêu chí mà hãng theo đuổi từ lúc thành lập cho tới bây giờ. Và để có thể thực hiện được điều đó, Simple luôn tuân thủ nguyên tắc nói không với các chất gây kích ứng nhờ vậy các mà các sản phẩm của hãng có thể dùng được cho mọi loại da, đặc biệt là những làn da nhạy cảm dễ kích ứng.\nNgay từ khi thành lập, Simple đã cam kết nói không với các thành phần gây kích ứng cho da với mong muốn có thể mang đến những sản phẩm an toàn cho làn da nhạy cảm và có thể sử dụng được đối với phụ nữ mang thai. Mỹ phẩm Simple nói KHÔNG với chất tạo mùi hương, KHÔNG chất tạo màu, KHÔNG cồn, KHÔNG chất bảo quản có hại và KHÔNG xà phòng.'),('TH0008','Vaseline','Mỹ','Thương hiệu Vaseline ra đời từ năm 1870. Hiện nay thương hiệu Vaseline đang được quản lý bởi tập đoàn Unilever với các dòng sản phẩm: kem dưỡng da, nước hoa, chất làm sạch, chất khử mùi... Bắt đầu nổi tiếng bằng sản phẩm sáp Vaseline do Robert Chesebrough tìm ra sau khi ông ghé thăm một mỏ dầu. Từ đó thương hiệu này đã làm một cuộc cách mạng và được sử dụng khắp mọi nơi trên toàn thế giới. Vào năm 1874, thương hiệu Vaseline đã được phân phối rộng rãi trên toàn nước Mỹ với kỷ lục phi thường: cứ mỗi phút lại bán được một sản phẩm. Ngoài công dụng chữa bỏng, sáp Vaseline còn được sử dụng để dưỡng môi và dưỡng da. Trước khi thương hiệu này trực thuộc tập đoàn Unilever, nó từng được chuyển nhượng cho Chesebrough Manufacturing. Các sản phẩm chăm sóc da của thương hiệu Vaseline hiện có mặt ở 60 nước trên toàn thế giới và được bày bán ở hệ thống các siêu thị trên cả nước. Thương hiệu Vaseline cũng như các sản phẩm khác đang được phân phối bởi tập đoàn Unilever rất được chị em phụ nữ và nhiều người tiêu dùng tin dùng.'),('TH0009','NIVEA','Đức','NIVEA là một trong những thương hiệu mỹ phẩm toàn cầu chuyên về chăm sóc da và dưỡng thể, thuộc công ty Beiersdorf của Đức, được thành lập vào năm 1882. NIVEA ban đầu được thành lập bởi dược sỹ Carl Paul Beiersdorf; tuy nhiên, phải đến khi người chủ mới là Ông Oskar Troplowitz tiếp nhận vào năm 1900, thương hiệu NIVEA mới tạo nên được thành công với dòng sản phẩm kem dưỡng ẩm NIVEA. NIVEA trong tiếng Latin có nghĩa là \"Snow-white\" (Tạm dịch là tuyết). Vào những năm của thập niên 1930, Beiersdorf bắt đầu cho sản xuất các sản phẩm như là kem cạo râu, dầu gội đầu, thuốc nhuộm da và dung dịch làm săn chắc da mặt. Thương hiệu NIVEA đã được biết đến rộng rãi ở rất nhiều quốc gia sau thế chiến thứ 2. Beiersdorf cũng hoàn tất việc mua lại bản quyền nhãn hiệu hàng hóa bị tịch thu vào năm 1997. Kể từ đó cho đến nay, thương hiệu NIVEA được rất nhiều khách hàng ưa chuộng bởi chất lượng thuyết phục và sự hiện diện tại nhiều quốc gia trên thế giới. Ngoài ra, NIVEA còn được biết đến với việc sử dụng nước hoa vào trong các sản phẩm của họ.'),('TH0010','Laura Anne','Singapore','aura Anne là một thương hiệu nước hoa thuộc công ty Venus - là một doanh nghiệp quốc tế chuyên về làm đẹp có trụ sở tại Singapore nhắm đến những bạn trẻ Việt Nam năng động, cá tính và hiện đại, bao gồm 6 mùi hương dành cho cả nam và nữ, phù hợp với 3 cá tính khác nhau của giới trẻ: Năng động - Quyến rũ - Mạnh mẽ.\nLaura Anne không chỉ muốn đem đến những mùi hương với chất lượng tốt, giá cả hợp lý với giới trẻ Việt Nam mà còn mang lại nguồn cảm hứng cho người tiêu dùng, mang lại cơ hội khám phá thế giới làm đẹp và trải nghiệm thế giới mùi hương, từ đó thể hiện cá tính riêng biệt của bản thân.'),('TH0011','Lacoste','Mỹ ','Thương hiệu Lacoste ra đời năm 1933, chuyên hoạt động về sản xuất thời trang may mặc. Đến năm 1984, hương nước hoa đầu tiên của hãng mới được ra đời. Không như những thương hiệu khác, dòng nước hoa đầu tiên của nước hoa Lacoste nam mang tên Lacoste, những năm sau đó nhãn hiệu vẫn tiếp tục cho sản xuất phiên bản dành cho nam như Land, Eau de Sport, Booster. Và sau gần 15 năm sau, Lacoste mới bắt đầu lấn sang thị trường nước hoa dành cho nữ.'),('TH0012','Lancôme','Pháp','Nhắc đến LANCÔME , người ta lại nhớ ngay đến thương hiệu gắn liền với biểu tượng hoa hồng vàng và vẻ đẹp Pháp. Vì tình yêu với nước Pháp nói chung và quyến rũ bởi vẻ đẹp người phụ nữ Pháp nói riêng, Armand Petitjean - người được coi là \"cha đẻ của nước hoa cao cấp thế kỷ 20\" (1884-1969) đã sáng lập ra thương hiệu Lancôme vào ngày 21/2/1935. Tên gọi LANCÔME bắt nguồn từ tên một tòa lâu đài nổi tiếng thời bấy giờ \"Le Château de Lancosme\" ở vùng Indre ngoại ô nước Pháp. Nơi đây mọc rất nhiều loài hoa hồng hoang dã. Armand Petitjean có niềm đam mê bất tận dành cho loài hoa hồng kiêu kỳ này. Năm 1935, thương hiệu LANCÔME giới thiệu năm mẫu nước hoa đầu tiên tại hội chợ thế giới. Một thời gian sau, LANCÔME được chuyển nhượng cho tập đoàn L\'Oreal từ năm 1964. Hiện tại, LANCÔME là thương hiệu chuyên về nước hoa, các sản phẩm chăm sóc da, mỹ phẩm. Ngoài ra, các gương mặt đại diện của hãng không chỉ là các ngôi sao, người mẫu mà còn là những nghệ sỹ make-up, nhà điều chế nước hoa. Hầu như mọi màu da đều có thể tìm được một loại kem nền phù hợp tại LANCÔME, kem che khuyết điểm, mascara nổi trội, dòng phấn Absolue, kẻ mắt nước, phấn mắt. Son môi và chì viền môi cũng là thế mạnh của LANCÔME.'),('TH0013','Pinker Bell','Hàn Quốc','\"Pinker Bell được mệnh danh là nước hoa thu hút nam giới, bán rất chạy ở Hàn Quốc… Những mùi nước hoa này là bản dupe của các thương hiệu nổi tiếng.'),('TH0014','Cocoon','Việt Nam','Cocoon là thương hiệu mỹ phẩm Việt Nam trực thuộc Natural Story. Là thương hiệu sử dụng những các nguyên liệu quen thuộc trong cuộc sống hằng ngày như rau củ, trái cây để tạo ra những sản phẩm mỹ phẩm an toàn và thân thiện với môi trường. Bằng cách tận dụng triệt để các vitamin, khoáng chất và chất chống oxy hóa để tăng cường sức khỏe làn da, mái tóc chị em chúng ta. Không chỉ thành phần 100% từ thiên nhiên mà quá trình gia công sản phẩm cũng được thực hiện tỉ mỉ từng công đoạn.'),('TH0015','DOVE','Mỹ','Dove là thương hiệu thuộc tập đoàn đa quốc gia Uninever. Dove là thương hiệu có uy tín toàn cầu với hơn 50 năm lịch sử và đang có mặt tại gần 100 quốc gia trên toàn thế giới. Nhãn hiệu Dove từng nổi tiếng với chiến dịch \"Real beauty\" nhằm thay đổi suy nghĩ của người phụ nữ về vẻ đẹp riêng của mình. \nỞ Việt Nam, các dòng sản phẩm của Dove cam kết luôn mang đến các giải pháp công nghệ tiên tiến nhất trong cả dầu gội, kem xả. Giúp nuôi dưỡng sâu, phục hồi phần tóc khô xơ, hư tổn.\nHiện tại Dove chăm sóc tóc có 3 dòng sản phẩm chính, giúp cải thiện những vấn đề khác nhau của mái tóc:\n- Dove phục hồi hư tổn với công thức Keratin Repair Active nuôi dưỡng và phục hồi tóc hư tổn.\n- Dove Dưỡng tóc bồng bềnh với công nghệ Oxyfusion giúp tóc bồng bềnh đến 95% thổi bùng sức sống cho tóc mỏng, xẹp.\n- Dove ngăn rụng tóc với Trichazole Actives dành cho tóc dễ gãy, rụng.'),('TH0016','Innerb','Hàn Quốc','Innerb là một thương hiệu tới từ xứ sở kim chi Hàn Quốc, trực thuộc tập đoàn nổi tiếng CJ CheiJedang. CJ chắc các bạn còn quen thuộc hơn đúng không nào, một ông lớn trong ngành kỹ thuật thực phẩm với những ứng dụng công nghệ sinh học mang lại các dòng thực phẩm an toàn cho con người, bao gồm cả thực phẩm chức năng.'),('TH0017','DHC','Nhật Bản','Trên 30 năm hoạt động, thương hiệu mỹ phẩm DHC là công ty chăm sóc da hàng đầu Nhật Bản với các sản phẩm được phát triển dựa trên nền tảng là tinh chất dầu olive giúp bạn duy trì một làn da tươi trẻ, khỏe khoắn.\nNgoài các sản phẩm nổi tiếng về chăm sóc da mặt như dầu tẩy trang DHC, son dưỡng DHC… Ngoài ra DHC còn phát triển các loại thực phẩm chức năng như collagen DHC chuyên sâu giúp chăm sóc cơ thể toàn diện. \n'),('TH0018','Naris Cosmetics','Nhật Bản','Naris Cosmetics là thương hiệu mỹ phẩm chăm sóc da và trang điểm được thành lập lâu đời tại Nhật Bản. Với những sản phẩm đươc sản xuất tập trung chủ yếu vào các thành phần thảo dược thiên nhiên an toàn lành tính đi cùng với chất lượng để đem tới hiệu quả tuyệt đối cho khách hàng, tính tới thời điểm hiện nay Naris nhanh chóng trở thành một trong những thương hiệu được ưa chuộng tại Nhật và sau đó phát triển khắp thị trường Hoa Kỳ, Trung Quốc, Thái Lan, Indonesia…\nNaris Cosmetics là thương hiệu nhắm tới đa dạng phân khúc người dùng với việc cho ra đời cả dòng sản phẩm cao cấp và bình dân. Bên cạnh đó, Naris Cosmetics còn phát triển hệ thống spa và showroom riêng biệt nhằm mang đến cho khách hàng những dịch vụ chăm sóc sắc đẹp hiệu quả nhất.'),('TH0019','NUCOS','Nhật Bản','Nucos là thương hiệu thực phẩm bổ sung chăm sóc sắc đẹp được sản xuất tại Nhật Bản. Những sản phẩm thuộc thương hiệu Nucos đều được sản xuất theo tiêu chuẩn cao nhất tại nhà máy AFC - HD AMS Life Science Co., Ltd ở thành phốShizouka, Nhật Bản. Các dòng sản phẩm của Nucos đang sản xuất gồm: Collagen dạng nước Nucos Spa; dạng viên Nucos Cells up và Nucos 100% Collagen; Viên uống trắng da - giảm thâm nám Nucos White; Thanh lọc và giảm cân cho cơ thể Nucos Diet&Detox. Các sản phẩm thuộc thương hiệu Nucos đang được nhập khẩu và phân phối độc quyền tại thị trường Việt Nam bởi Công ty TNHH Profa Việt Nam.'),('TH0020','Sanga','Hàn Quốc','Dòng thương hiệu Sanga nổi tiếng của xứ sở Kim Chi luôn là lựa chọn an toàn nếu bạn còn đang phân vân không biết nên sử dụng loại thực phẩm chức năng giảm cân nào đảm bảo cho sức khỏe mà vẫn mang lại hiệu quả như ý.'),('TH0021','CLEAR','Mỹ','Nhãn hiệu CLEAR là một trong những nhãn hiệu dầu gội đầu trị gàu nổi tiếng nhất của tập đoàn Unilever. CLEAR cung cấp các sản phẩm dầu gội đầu với các giải pháp công nghệ cao giúp trị gàu và các vấn đề của da đầu khác như ngứa, khô và bết dầu. Công nghệ được cấp bằng sáng chế toàn cầu của CLEAR đã tạo nên một cuộc cách mạng hóa, trong đó có công nghệ tùy biến - TECH CLEAR ® cho cả nam và nữ, giúp loại bỏ gàu, nuôi dưỡng da đầu và ngăn ngừa gàu quay trở lại. Dựa vào khoa học lâm sàng, việc trị gàu không chỉ là loại bỏ Malassezia. Lớp chắn bảo vệ da đầu mới đóng một vai trò quan trọng cho sức khỏe da đầu. Lớp chắn bảo vệ da đầu được hồi phục sẽ tăng cường sức khỏe da đầu: giúp giảm sự mất nước của các biểu bì da đầu, vì vậy mà giảm khô da đầu, chống gàu quay trở lại. Kể từ khi được nghiên cứu bởi phòng thí nghiệm của Unilever tại Paris, CLEAR được các người tiêu dùng trên toàn thế giới ưa chuộng với hơn 1 triệu người sử dụng. Ngoài ra, hãng đã có mặt trên 40 quốc gia trên toàn thế giới như: Belgium, Brazil, Canada, China, Chile, Colombia, Denmark, France, Germany, Hong Kong, India Indonesia, Korea, Kuwait, Malaysia, Mexico, Morocco, Netherlands, Pakistan, Philippines, Poland, Portugal, Romania, Russia, Saudi Arabia, Singapore, Spain, Sri Lanka,Sweden, Switzerland, Taiwan, Thailand, Turkey, UAE, Ukraine, USA, Venezuela, Vietnam');
