INSERT INTO `sanpham` VALUES ('SP0001','Kem Nền Maybelline Mịn Nhẹ Kiềm Dầu Chống Nắng #120 30ml','2021-05-02','2022-12-21','Kem Nền Maybelline Mịn Nhẹ Kiềm Dầu Chống Nắng Matte Poreless Foundation SPF 22 30ml là kem nền đến từ thương hiệu mỹ phẩm MAYBELLINE của Mỹ, với công nghệ Micro Powders hạt phấn siêu nhỏ không dầu, không hương liệu độc quyền cho hiệu ứng mịn lì tự nhiên, tiệp màu da cùng khả năng kiềm dầu hiệu quả cả ngày dài, phù hợp cho da dầu.',238000,'LSP001','TH0001',12),('SP0002','Phấn Má Hồng Maybelline Màu Hồng 30 Rose 4.5g','2020-12-21','2023-12-21','Những hộp phấn má hồng nhỏ xinh tưởng chừng như không cần thiết nhưng lại rất quan trọng để bạn có được vẻ ngoài rạng rỡ hoàn hảo. Đôi khi chỉ cần dặm nhẹ chút phấn nước mỏng, thoa chút son, điểm xuyết thêm chút má hồng là bạn đã \"nâng tầm\" nhan sắc của mình hơn rất nhiều rồi đấy. Hasaki xin giới thiệu với các bạn dòng phấn má hồng dạng nén Maybelline Fit Me Mono Blush với 4 tông màu nhẹ nhàng trẻ trung được chọn lọc phù hợp với tông da châu Á, chất phấn mịn màng dễ tán cùng khả năng kiềm dầu, giúp giữ da bạn luôn khô thoáng, không bóng nhờn.',80000,'LSP001','TH0001',7),('SP0003','Son Môi L\'Oreal Mịn Lì Cao Cấp 215 Đỏ Cam 3.7g','2021-05-01','2024-05-01','Son Mịn Lì Cao Cấp L\'Oréal Paris Color Riche Matte 3.7g là dòng son môi dạng thỏi với thiết kế đầy sang trọng và thời thượng đến từ thương hiệu mỹ phẩm L\'Oréal Paris. Sản phẩm sở hữu chất son lì gợi cảm, lên chuẩn chỉ với 1 lần lướt nhưng vẫn mềm mượt và nhẹ môi, kết hợp cùng thành phần tinh dầu Jojoba giúp đôi môi được ẩm mượt, không lo khô môi suốt cả ngày dài. Bộ sưu tập với hơn 40 màu sắc khác nhau, giúp các nàng thoải mái lựa chọn màu son phù hợp cho mọi hoàn cảnh. Dù tone đỏ quyền lực, hồng ngọt ngào hay nude thời thượng. L\'Oréal Paris Color Riche Matte sẽ giúp đôi môi bạn trở nên tỏa sáng hơn bao giờ hết.',138000,'LSP001','TH0002',12),('SP0004','Son Kem Lì Nhẹ Môi Cao Cấp L\'Oréal Paris 113 I Don\'t 7ml','2021-06-12','2025-06-12','L\'Oreal Rouge Signature Matte Liquid Lipstick là dòng son kem mịn lì cao cấp đến từ thương hiệu L\'Oreal Paris nổi tiếng xuất xứ từ Pháp, có kết cấu son mỏng mượt và \"nhẹ tênh như không\" khi lên môi, cho lớp finish đúng chuẩn son lì nhưng vẫn mang lại cảm giác mềm mại và mịn màng như nhung. Đặc biệt, son có khả năng lên màu cực chuẩn ngay từ lần đầu tiên chạm môi và bền màu lâu trôi lên đến 8 giờ sau khi sử dụng.',250000,'LSP001','TH0002',11),('SP0005','Nước Tẩy Trang Mắt Môi SENKA 150ml','2021-05-05','2025-05-05','Nước Tẩy Trang Mắt Môi SENKA All Clear Eye & Lip giúp làm sạch nhanh chóng các lớp trang điểm dày & lâu trôi, đặc biệt ở vùng mắt môi, tẩy sạch cả son kem lì, son nước lâu trôi (sont tint), mascara & eyeliner, eyeshadow chống thấm nước… chỉ với thao tác nhẹ nhàng, không cần chà xát, đồng thời loại bỏ bụi bẩn, bã nhờn, giúp da sạch thoáng, sáng rạng rỡ. Công thức dịu nhẹ cung cấp thêm độ ẩm cho da mịn mượt. Có thể sử dụng cho toàn da mặt.',150000,'LSP001','TH0003',11),('SP0006','Chì Kẻ Mày 2 Đầu Maybelline Màu Nâu Tự Nhiên Natural Brown 0.16g','2021-05-02','2024-12-02','Nếu đôi mắt là cửa sổ tâm hồn, thì lông mày giữ vị trí quan trọng trong việc tạo thần thái cho gương mặt. Đôi mắt trông sẽ quyến rũ hơn rất nhiều khi bên trên là đôi mày dày, rậm và sắc nét. Tuy nhiên, nếu có lỡ sở hữu một đôi chân mày thưa, nhạt và quá mỏng, bạn vẫn có thể hoàn toàn yên tâm vì đã có Chì Kẻ Mày 2 Đầu Maybelline Define & Blend Brow Pencil hỗ trợ che giấu những khuyết điểm không đáng có này. Sản phẩm được thiết kế với dạng bút vặn tiện lợi với đầu chì xéo cùng thiết kế đầu chổi chải đi kèm giúp việc kẻ và tán chân mày được dễ dàng và chính xác.',300000,'LSP001','TH0001',10),('SP0007','Mascara L\'Oreal Không Trôi, Làm Dày & Dài Mi Blackest Black 8.5ml','2021-03-21','2024-03-21','Nếu bạn vẫn luôn băn khoăn vì lo sợ những cơn mưa bất chợt có thể khiến bạn khó xử với đôi mắt lem đầy mascara. Để giải toả những lo lắng đó, bạn chỉ cần chọn cho mình một loại mascara có khả năng chống thấm nước là đã có thể giải quyết được vấn đề. Và Makeup Voluminous Lash Paradise Waterproof Mascara đến từ thương hiệu L’Oreal Paris là sản phẩm đáng tin cậy.',180000,'LSP001','TH0001',12),('SP0008','Bảng Phấn Mắt 6 Màu SILKYGIRL 02 Blossom','2021-01-12','2025-01-12','Để sở hữu một “đôi mắt biết nói” chinh phục người đối diện là điều mà phái đẹp luôn hướng tới mỗi khi trang điểm . Đôi mắt long lanh hút hồn thường là một đôi mắt sáng, có chiều sâu, lung linh và sống động. Chính vì vậy mà Phấn Mắt 6 Màu SILKYGIRLTruly Nude Eye Shadow Palette trở thành một người bạn vô cùng thân thiết của đôi mắt phái đẹp.',250000,'LSP001','TH0004',12),('SP0009','Sữa Rửa Mặt Cetaphil Dịu Nhẹ Không Xà Phòng 500ml','2021-03-24','2024-03-24','Sữa Rửa Mặt Dịu Nhẹ Cho Mọi Loại Da Cetaphil Gentle Skin Cleanser là sản phẩm đến từ thương hiệu Cetaphil của Canada,thuộc công ty dược nổi tiếng Galderma Laboratories với mạng lưới phân phối rộng khắp thế giới, được các chuyên gia da liễu bào chế với thành phần giúp da mềm mại hoàn toàn không gây kích ứng với cả những làn da nhạy cảm.',250000,'LSP002','TH0005',12),('SP0010','Gel Sữa Chống Nắng Senka SPF50/PA++++ 80g','2021-04-12','2024-04-12','Gel Sữa Chống Nắng SENKA Perfect UV Gel SPF50/PA++++ 80g là dòng sản phẩm chống nắng đến từ thương hiệu mỹ phẩm Senka của Nhật Bản, với chỉ số chống nắng phổ rộng vượt trội SPF 50+ PA++++ bảo vệ da khỏi tác hại của tia tử ngoại, ngăn ngừa sự hình thành của đốm nâu, sạm da, có thể dùng như lớp lót trang điểm',160000,'LSP002','TH0003',12),('SP0011','Sữa Rửa Mặt Senka Tạo Bọt Chiết Xuất Tơ Tằm Trắng 150g','2021-02-15','2024-02-15','Sữa Rửa Mặt Tạo Bọt SENKA Perfect Whip Facial Foam Wash đến từ thương hiệu mỹ phẩm Senka thuộc tập đoàn Shiseido Nhật Bản, với lớp bọt tơ tằm trắng bông mịn giúp làm sạch sâu lỗ chân lông, kết hợp cùng công nghệ Aqua in Pool độc quyền sẽ mang lại cho bạn một làn da sạch hoàn hảo nhưng vẫn ẩm mịn tự nhiên, không gây cảm giác khô căng.',90000,'LSP002','TH0003',12),('SP0012','Bộ Sản Phẩm Chăm Sóc Da Mụn Some By Mi 3 Món','2021-03-16','2024-03-26','SOME BY MI là thương hiệu đến từ Hàn Quốc, chuyên sản xuất các sản phẩm làm đẹp thiết thực nhưng vẫn hợp thời trang. Các sản phẩm của hãng được chiết xuất từ các thành phần thiên nhiên, kể cả các sản phẩm chăm sóc da đến các sản phẩm trang điểm. Nổi tiếng nhất phải kể đến là Nước Hoa Hồng Cho Da Mụn Miracle Toner AHA- BHA-PHA 30 Days đã nhận được \"cơn mưa lời khen\" từ cộng đồng làm đẹp nhờ khả năng làm giảm mụn và mang lại làn da mịn màng, khỏe mạnh chỉ trong 30 ngày sử dụng đều đặn. Tiếp nối thành công, SOME BY MI tiếp tục cho ra đời các sản phẩm cùng dòng AHA- BHA-PHA 30 Days để hoàn thiện quy trình chăm sóc cho làn da mụn, nhạy cảm. Và để giúp khách hàng có được sự trải nghiệm trước khi sử dụng toàn bộ dòng sản phẩm chăm sóc da mụn, cũng như tiện lợi hơn khi cần dưỡng da trong lúc đi du lịch hay công tác, SOME BY MI đã cho ra mắt Bộ Sản Phẩm Chăm Sóc Da Mụn 3 Món Some By Mi AHA-BHA-PHA 30 Days Travel Kit với dung tích mini size nhỏ gọn.',300000,'LSP002','TH0006',9),('SP0013','SOME BY MI\nSữa Rửa Mặt Cho Da Mụn Some By Mi 100ml','2020-12-20','2023-12-20','Làn da mụn nhạy cảm rất dễ bị kích ứng, đỏ, bong tróc khi dùng các sản phẩm chăm sóc da thông thường, việc lựa chọn sữa rửa mặt phù hợp cho da mụn cũng gặp nhiều khó khăn. Thấu hiểu nỗi lo của các nàng da mụn, thương hiệu mỹ phẩm SOME BY MI Hàn Quốc đã cho ra đời dòng sản phẩm chăm sóc riêng biệt chuyên dành cho da mụn nhạy cảm, giúp làm dịu da, giảm kích ứng đồng thời giảm mụn trứng cá hiệu quả mà vẫn êm dịu. Một trong số những sản phẩm nổi trội là Sữa Rửa Mặt Cho Da Mụn Some By Mi 30 Days Miracle Acne Clear Foam – với công thức đặc biệt chứa phức hợp AHA – BHA – PHA hỗ trợ làm sạch tận sâu lỗ chân lông, lấy đi hết bụi bẩn, bã nhờn cho làn da thông thoáng không còn bí tắc, nhưng vẫn nhẹ dịu không gây kích ứng hay khô căng da, làm giảm mụn trứng cá và tình trạng da mẩn đỏ, kích ứng hiệu quả. ',250000,'LSP002','TH0006',5),('SP0014','Nước Hoa Hồng Simple Dành Cho Da Nhạy Cảm 200ml','2020-12-01','2024-12-01','Nước Hoa Hồng Simple Dành Cho Da Nhạy Cảm Kind to Skin Soothing Facial Toner 200ml đến từ thương hiệu chăm sóc da Simple xuất xứ Anh Quốc là sản phẩm Toner không chứa cồn được thiết kế phù hợp cho làn da nhạy cảm và dễ nổi mụn, giúp làm sạch sâu và cân bằng độ pH, cung cấp độ ẩm dịu nhẹ cho làn da, mang lại cảm giác tươi mát và sảng khoái sau khi sử dụng.',150000,'LSP002','TH0007',17),('SP0015','Kem Dưỡng Ẩm Và Hỗ Trợ Phục Hồi Da Ban Đêm Simple 50ml\n','2020-09-20','2022-09-20','Dưỡng ẩm là công đoạn chăm sóc da không thể thiếu, Kem Dưỡng Ẩm Simple Vital Vitamin Cream Night có tác dụng hỗ trợ tái tạo phục hồi da vào ban đêm, loại trừ các tác nhân hình thành nếp nhăn, lão hóa trên da với thành phần dịu nhẹ, lành tính mà không gây tình trạng kích ứng da. Đây sẽ là lựa chọn phù hợp với nhiều công dụng được tích hợp trong một sản phẩm đấy nhé!',210000,'LSP002','TH0007',25),('SP0016','Gel Rửa Mặt Simple Dành Cho Da Nhạy Cảm 150ml','2020-08-12','2023-08-12','Gel Rửa Mặt Simple Kind To Skin Refreshing Facial Wash Gel là sản phẩm sữa rửa mặt dạng gel từ thương hiệu mỹ phẩm Simple xuất xứ Anh Quốc, với công thức dịu nhẹ và thành phần lành tính phù hợp với mọi loại da, kể cả da nhạy cảm. Sản phẩm giúp nhẹ nhàng làm sạch da, loại bỏ lớp trang điểm hay bụi bẩn và các tạp chất khác còn sót lại sau khi tẩy trang, đem lại làn da tươi mát và đầy sức sống.',125000,'LSP002','TH0007',3),('SP0017','Sữa Tắm Và Gội Cetaphil 2 Trong 1 Dịu Nhẹ Cho Bé 230ml','2021-03-12','2023-03-12','Chọn sữa tắm và dầu gội cho con là câu chuyện khá đau đầu của nhiều bà mẹ bỉm sữa, bởi lẽ, da trẻ sơ sinh vô cùng nhạy cảm và có thể phản ứng với bất kỳ loại hóa mỹ phẩm nào, dù đó là sản phẩm được sản xuất dành riêng cho bé. Hãy để Sữa Tắm Gội Dịu Nhẹ Cho Bé Baby Gentle Wash & Shampoo của Cetaphil giúp bạn bớt lo toan vấn đề này. Đây là sản phẩm được chọn lọc kỹ lưỡng từ các thành phần tự nhiên phù hợp cho làn da trẻ từ độ tuổi sơ sinh trở lên, không chứa hóa chất nên hoàn toàn không gây kích ứng cho mọi làn da, kể ca da nhạy cảm. Sản phẩm không những làm sạch bụi bẩn mà còn có tính kháng khuẩn tốt giúp da bé giảm dần sự ngứa ngáy, vết hăm, sảy, mẩn đỏ do vi khuẩn tấn công..',150000,'LSP003','TH0005',18),('SP0018','Sữa Tắm SOME BY MI Làm Giảm Mụn 400g','2021-02-09','2021-02-09','Sữa Tắm Some By Mi Làm Giảm Mụn AHA-BHA-PHA 30 Days Miracle Acne Clear Body Cleanser 400g là dòng sữa tắm đến từ thương hiệu SOME BY MI của Hàn Quốc chứa thành phần AHA, BHA, PHA giúp làm sạch lỗ chân lông và kiểm soát dầu cùng với chiết xuất từ tràm trà, bạch đàn giúp ngăn ngừa và cải thiện tình trạng mụn xuất hiện trên các vùng cơ thể. ',220000,'LSP003','TH0006',29),('SP0019','Sữa Tắm Dưỡng Ẩm SENKA Hương Hoa Hồng & Đinh Hương 500ml','2021-04-15','2025-04-15','Sữa Tắm Dưỡng Ẩm Hương Hoa SENKA Perfect Bubble For Body Floral 500ml là sản phẩm của thương hiệu Senka Nhật Bản với hương thơm tươi mát từ các loài hoa cùng công nghệ chuyển hoá mùi độc đáo, khử mùi mồ hôi hiệu quả. Đồng thời giúp bạn loại bỏ các bụi bẩn ra khỏi cơ thể sau một ngày dài nhờ lớp bọt bông mềm mịn màng, giúp da sạch hơn và dưỡng trắng dần cho da. Thành phần giữ ẩm giúp da luôn mịn màng và tươi mát.',250000,'LSP003','TH0003',14),('SP0020','Sữa Dưỡng Thể Vaseline Dịu Mát Sáng Da 200ml','2020-12-29','2023-12-29','Sữa Dưỡng Thể Sáng Da Body Lotion 200ml là sản phẩm dưỡng thể đến từ thương hiệu mỹ phẩm VASELINE của Mỹ, với công thức cải tiến dòng sản phẩm White Lotion mang lại hiệu quả trắng sáng vượt trội nhưng vẫn giữ độ ẩm cần thiết cho da. ',900000,'LSP003','TH0008',17),('SP0021','Sữa Dưỡng Thể Nivea Làm Sáng & Săn Chắc Da Ban Đêm 400ml','2020-12-28','2023-12-28','Sữa Dưỡng Thể Nivea Extra White Body Lotion là dòng sản phẩm dưỡng thể làm sáng da toàn thân nổi tiếng của thương hiệu NIVEA, với công nghệ Deep White Essence chứa các hạt phân tử dưỡng sáng siêu nhỏ cùng hàm lượng Vitamin C cô đặc gấp 40 lần, nuôi dưỡng sâu các tế bào da, mang lại cho bạn làn da sáng mịn rạng rỡ.',120000,'LSP003','TH0009',14),('SP0022','Sữa Dưỡng Thể Vaseline Sáng Da & Ngăn Ngừa Lão Hóa 200ml','2021-02-13','2024-02-13','Sữa Dưỡng Thể Sáng Da Body Lotion 200ml là sản phẩm dưỡng thể đến từ thương hiệu mỹ phẩm VASELINE của Mỹ, với công thức cải tiến dòng sản phẩm White Lotion mang lại hiệu quả trắng sáng vượt trội nhưng vẫn giữ độ ẩm cần thiết cho da',100000,'LSP003','TH0008',21),('SP0023','Sữa Dưỡng Thể Nivea Dưỡng Sáng Da Hương Hoa Anh Đào 350ml','2020-09-30','2023-09-30','Sữa Dưỡng Thể Dưỡng Sáng Da Hương Hoa Nivea White Lotion thuộc dòng sữa dưỡng thể hương hoa mới ra mắt từ thương hiệu chăm sóc da Nivea nổi tiếng xuất xứ từ Đức, giúp nuôi dưỡng làn da sáng mịn và căng mượt tức thì, đồng thời lưu lại hương hoa tinh tế, lan tỏa sức hút tự nhiên trong suốt cả ngày dài.',133000,'LSP003','TH0009',3),('SP0024','Xịt Ngăn Mùi Nữ Nivea Sáng Da, Mờ Vết','2021-02-12','2024-02-12','Xịt Khử Mùi Sáng Mịn Mờ Vết Thâm Extra Whitening Antiperspirant Deodorant Spray là sản phẩm khử mùi dạng xịt cho vùng da dưới cánh tay trắng mịn, mờ vết thâm chỉ trong 7 ngày. Đồng thời giảm tiết mồ hôi và ngăn mùi hiệu quả suốt 48 giờ. Sản phẩm giúp giảm tiết mồ hôi và ngăn mùi hiệu quả suốt 48 giờ, cho bạn bạn tự tin suốt ngày dài năng động. Tinh chất đặc biệt có trong Xịt khử mùi Nivea mang lại hương thơm dễ chịu đến 48 giờ cho bạn tự tin hoạt động, thoải mái diện đồ mà không lo lắng về vấn đề mồ hôi hay mùi cơ thể vùng dưới cánh tay.',80000,'LSP003','TH0009',7),('SP0025','Sáp Ngăn Mùi Nivea Dưỡng Sáng Da Ngọc Trai 40ml','2020-05-30','2023-05-30','Mồ hôi trên cơ thể được tiết ra dưới dạng nước và không hề có mùi với mục đích điều tiết nhiệt độ và độ ẩm cho da. Tuy nhiên, do một số loại vi khuẩn trên da làm cho mồ hôi trở nên có mùi. Hasaki.vn xin giới thiệu Sáp Ngăn Mùi Dưỡng Sáng Da Ngọc Trai Nivea Pearl & Beauty Anti-Perspirant 48h Protection giúp khử mùi & ngăn tiết mồ hôi hiệu quả, lưu giữ hương thơm tự nhiên kéo dài lên đến 48 giờ, đồng thời dưỡng sáng vùng da dưới cánh tay với chiết xuất ngọc trai',71000,'LSP003','TH0009',14),('SP0026','Nước Hoa Nữ Laura Anne Little Black Dress 50ml','2020-06-28','2025-06-28','Là con gái, bạn hãy cũng cứ như một đóa hóa, đôi lúc cần lắm một mùi hương đủ thơm, đủ lôi cuốn để gây sự chú ý và thu hút sự tập trung về phía mình. Mùi hương ấy tuyệt nhiên sẽ mang đến cho bạn một phong cách riêng biệt, và là \"một loại phụ kiện vô hình\" nhưng mang sức khẳng định vô cùng rõ ràng và mạnh mẽ. ',180000,'LSP004','TH0010',24),('SP0027','Nước Hoa Nam Laura Anne Diamond Homme 45ml','2021-02-12','2026-02-12','Ngoại hình hay nhan sắc không hẳn là thứ vũ khí duy nhất giúp bạn tạo ấn tượng với người đối diện. Bên cạnh một phong thái đỉnh đạc hay quyến rũ, thì hương thơm chính là bí quyết giúp bạn trở nên ấn tượng và chiếm được cảm tình. Nước Hoa Laura Anne Diamond 45ml với thiết kế cổ điển, thanh lịch sẽ giúp bạn lưu lại trên người hương thơm đầy quyến rũ, đầy mê hoặc, giúp bạn tự tin hơn khi giao tiếp. Ngoài ra, có thể bạn chưa biết nhưng việc lựa chọn hương thơm phù hợp với thần thái của chính mình là một cách rất tốt để “báo hiệu” cho đối phương biết được tâm trạng hiện tại của bạn ra sao. Bất kể bạn đang buồn hay vui, mùi hương nước hoa trên cơ thể sẽ giúp bạn nhanh chóng đưa tâm trạng đó đến đối phương mà chẳng cần bạn mở lời hay thể hiện. Còn gì thú vị hơn việc tự khám phá cá tính bản thân thông quá việc trải nghiệm thế giới mùi hương đầy màu sắc đến từ Laura Anne nữa chứ.',500000,'LSP004','TH0010',27),('SP0028','Nước Hoa Nữ LACOSTE L.12.12 Pour Elle Sparkling EDT 30ml','2020-12-19','2025-12-19','Lacoste vừa giới thiệu bộ sưu tập nước hoa mới mang tên Eau De Lacoste L.12.12 Pour Elle dành cho nữ trước đó là bộ sưu tập của nam giới. Lấy cảm hứng từ những bộ váy xếp li trong môn tennis, bộ ba nước hoa này mang phong cách thanh lịch, tự nhiên, trẻ trung, mỗi phiên bản đại diện cho một tâm trạng của người phụ nữ. Lacoste L.12.12 Pour Elle Sparkling ra mắt năm 2015.',980000,'LSP004','TH0011',4),('SP0029','Nước Hoa Nữ Lancôme La Vie Est Belle Enrose EDT 50ml','2020-11-10','2024-11-10','Nước Hoa Nữ Lancôme La Vie Est Belle Enrose EDT 50ml là một nốt hương Fruity Floriental của dòng nước hoa kinh điển La Vie Est Belle đến từ thương hiệu mỹ phẩm cao cấp Lancôme. Mùi hương Eau De Toilette này là sự kết hợp giữa hương hoa diên vĩ cùng hoa mẫu đơn và hoa hồng, thêm một chút nhẹ nhàng, thanh thoát của hương đầu trái cây, tất cả tạo nên một mùi hương hoa cỏ trái cây ngọt ngào, thanh lịch.',2200000,'LSP004','TH0012',4),('SP0030','Nước Hoa Lancôme La Nuit Trésor Musc Diamant EDP 75ml','2021-01-02','2026-02-02','Nước Hoa Lancôme La Nuit Trésor Musc Diamant EDP là phiên bản nước hoa nữ mới ra mắt năm 2019, thuộc dòng La Nuit Trésor của thương hiệu mỹ phẩm cao cấp Lancôme, với thiết kế đá quý hoàn toàn mới - tựa như một viên kim cương trắng đang tỏa sáng. Mang âm hưởng của nhóm Hoa Cỏ Phương Đông, La Nuit Trésor Musc Diamant được ví như là một tác phẩm hoa mỹ chứa đựng sự gợi cảm, ngọt ngào, pha chút tươi mới nhưng sạch sẽ và cuốn hút đầy bất ngờ.',2175000,'LSP004','TH0012',20),('SP0031','Nước Hoa Nữ Lancôme La Vie Est Belle EDP 75ml','2020-12-16','2025-12-16','La Vie Est Belle Eau De Parfum một hương thơm mới vừa ra đời trong mùa thu năm 2012 bởi thương hiệu cao cấp Lancôme. Khái niệm hương thơm này tập trung ý tưởng về vẻ đẹp tự nhiên và giản dị, tự do từ các công ước và chọn lựa tầm nhìn cho hạnh phúc riêng của bạn. Nước hoa mang 1 phẩm chất triển vọng về cuộc sống và được lấy cảm hứng từ niềm vui trong những điều nhỏ nhặt.',2300000,'LSP004','TH0012',25),('SP0032','Nước Hoa Pinker Bell 01 Rainy Day EDP 30ml','2021-03-19','2026-03-19','Nước Hoa Pinker Bell Eau De Perfume 30ml là dòng nước hoa nữ đến từ thương hiệu nước hoa Pinker Bell của Hàn Quốc, với nồng độ tinh dầu 12 - 20% giúp độ lưu hương lên đến 6 tiếng, mùi hương đa dạng được xem là bản dupe của các hãng nước hoa nổi tiếng trên thế giới. Thiết kế sang trọng, tinh tế nhỏ gọn dễ mang theo bên mình.',275000,'LSP004','TH0013',14),('SP0033','Nước Hoa Pinker Bell 04 Lovey Day EDP 30ml','2021-05-02','2026-05-02','Nước Hoa Pinker Bell Eau De Perfume 30ml là dòng nước hoa nữ đến từ thương hiệu nước hoa Pinker Bell của Hàn Quốc, với nồng độ tinh dầu 12 - 20% giúp độ lưu hương lên đến 6 tiếng, mùi hương đa dạng được xem là bản dupe của các hãng nước hoa nổi tiếng trên thế giới. Thiết kế sang trọng, tinh tế nhỏ gọn dễ mang theo bên mình.',290000,'LSP004','TH0013',28),('SP0034','Nước Dưỡng Tóc Cocoon Tinh Dầu Bưởi (Phiên Bản 2020) 140ml','2020-12-21','2024-12-21','Nước Dưỡng Tóc Cocoon Tinh Dầu Bưởi Pomelo Hair Tonic 140ml là dòng chăm sóc tóc đến từ thương hiệu mỹ phẩm Cocoon của Việt Nam, sẽ là giải pháp giúp bạn xóa tan đi nỗi lo rụng tóc với tinh dầu vỏ bưởi tự nhiên có đặc tính chống oxy hóa và làm sạch, kết hợp hoạt chất Xylishine và vitamin B5 cung cấp dưỡng chất tuyệt vời cho da đầu, thúc đẩy sự phát triển tóc chắc khỏe.',115000,'LSP005','TH0014',12),('SP0035','Kem Ủ L\'Oréal Paris Ngăn Rụng Tóc 200ml','2020-11-20','2024-11-20','Bạn luôn phải lo lắng tin vì mái tóc yếu, dễ gãy rụng của mình. Thậm chí bạn còn không dám tạo kiểu tóc khi đi chơi hay đến các buổi tiệc, điều đó khiến cho bạn mất tự tin hơn. Hiểu được những nỗi lo và khó khắn đó, viện nghiên cứu L’Oreal Paris đã cho ra đời dòng sản phẩm ngăn gãy rụng tóc Fall Resist 3X hoàn toàn mới với 3 công dụng chăm sóc chống gãy rụng hoàn hảo. Kem ủ ngăn gãy rụng tóc L\'Oréal Fall Repair 3X Mask ngăn gãy rụng được bổ sung Arginine và axit amin thiết yếu cho quá trình tái tạo và phát triển của tóc. Fall Resist 3X giúp ngăn ngừa gãy rụng với 3 tác động tuyệt vời: Nuôi dưỡng, phục hồi và giúp tóc mọc khỏe mạnh hơn',90000,'LSP005','TH0002',3),('SP0036','Dầu Gội L\'Oreal Hỗ Trợ Phục Hồi Tóc Hư Tổn 650ml','2021-01-03','2025-01-03','Dầu gội L\'Oréal Total Repair 5 Repairing với 5 tác động giúp phục hồi tóc hư tổn từ sâu bên trong, sẽ mang đến cho bạn mái tóc chắc khỏe, tràn đầy sức sống. Hoạt chất linh hoạt được tích hợp trong sản phẩm sẽ thẩm thấm sâu vào bên trong từng sợi tóc nhanh chóng phục hồi và nuôi dưỡng giúp mái tóc trở nên mềm mượt và óng ả hơn bao giờ hết.',120000,'LSP005','TH0002',13),('SP0037','Kem Xả Dove Phục Hồi Hư Tổn Cho Tóc Chắc Khỏe 610g','2021-03-06','2023-03-06','Kem Xả Dove Phục Hồi Hư Tổn Cho Tóc Chắc Khỏe là dòng kem xả đến từ thương hiệu chăm sóc tóc Dove thuộc tập đoàn Unilever của Mỹ, với hệ dưỡng chất tự nhiên Bio-Nourish và công nghệ định vị chính xác giúp xác định và phân bổ dưỡng chất theo các cấp độ hư tổn khác nhau trên mái tóc, tóc được nuôi dưỡng sâu, phục hồi ở những nơi cần thiết mà không để lại dư thừa hay gây bết dính, mái tóc suôn mượt, óng ả và mềm mại hơn hẳn so với chỉ sử dụng dầu gội.',105000,'LSP005','TH0015',3),('SP0038','Kem Xả Dove Phục Hồi Hư Tổn Chiết Xuất Bơ & Dầu Argan 500g','2021-02-19','2024-02-19','Thương hiệu Dove nổi tiếng về các sản phẩm chăm sóc nuôi dưỡng mái tóc nay đã cho ra mắt dòng sản phẩm gội – xả chiết xuất thảo mộc Botanical Selection được nhập khẩu 100% từ Nhật Bản. Bộ sản phẩm là sự hòa quyện giữa các thành phần chiết xuất tự nhiên như quả bơ, hoa sen, dầu Argan, dầu Jojoba giúp nuôi dưỡng cho mái tóc bóng mượt và khỏe mạnh, cùng mùi hương dịu nhẹ tươi mát mang lại cảm giác thật sự thư giãn cho bạn sau một ngày dài mệt mỏi. Đặc biệt, dòng sản phẩm Botanical Selection không chứa thành phần Silicone, không gây bết nặng hay rụng tóc, giữ cho mái tóc luôn sạch khỏe. ',120000,'LSP005','TH0015',19),('SP0039','Dầu Gội Cetaphil Dịu Nhẹ Dành Cho Em Bé 200ml','2020-10-30','2024-10-30','Việc tắm gội - vệ sinh hàng ngày cho bé là một việc làm không thể thiếu trong đời sống sinh hoạt hàng ngày. Để có thể làm sạch tóc và cơ thể của bé thì ta cần dùng đến sữa tắm và dầu gội cho bé nhưng không phải loại nào bé cũng có thể dùng được, một số loại có thể gây hại đến làn da của bé. Vì vậy, để đảm bảo an toàn của bé, các mẹ hãy tinh tế và cẩn thận trong khâu lựa chọn dầu gội, sữa tắm cho bé, bởi lẽ lúc nay, làn da bé còn non nớt, hệ miễn dịch kém nên rất dễ tổn thương. Dầu Gội Cho Bé Baby Shampoo là dòng sản phẩm cao cấp của Canada mang thương hiệu Cetaphil được sản xuất theo công thức đặc biệt dành cho mọi loại da của các bé, được nhiều gia đình Châu Âu sử dụng rộng rãi, đã được Viện Da Liễu Châu Âu chứng nhận độ an toàn cho da cũng như được nhiều bác sĩ khoa nhi khuyên dùng.',130000,'LSP005','TH0005',23),('SP0040','Dầu Gội Clear Men Sạch Gàu Deep Cleanse Sạch Sâu 650g','2021-04-20','2024-04-20','Dầu Gội Sạch Gàu CLEAR Men là dòng sản phẩm dầu gội đầu dành cho nam giới đến từ thương hiệu CLEAR thuộc tập đoàn UNILEVER - nhãn hiệu hàng đầu tại Việt Nam về dầu gội sạch gàu. Được nghiên cứu dành riêng cho da đầu nam giới - da đầu đặc biệt dễ bị gàu, dầu gội CLEAR Men mới với công thức Gel đột phá lần đầu tiên xuất hiện trên thị trường, nhân đôi sức mạnh giúp làm sạch gàu vượt trội & nuôi dưỡng da đầu, đồng thời ngăn ngừa gàu quay trở lại.',133000,'LSP005','TH0015',7),('SP0041','Dầu Gội CLEAR Tinh Chất Lựu Đỏ Nuôi Dưỡng Da Đầu Khô 380ml','2021-03-20','2024-03-20','Lấy cảm hứng từ xu hướng dầu gội sử dụng công nghệ Micellar đang cực kì hot hiện nay, thương hiệu CLEAR đình đám cũng vừa tung ra thị trường dòng sản phẩm dầu gội CLEAR Scalp Therapy Anti-Dandruff Shampoo với công thức Micellar hoàn toàn mới chứa 0% silicone và paraben, giúp chăm sóc & nuôi dưỡng da đầu, làm sạch gàu và ngăn ngừa gàu hiệu quả, trả lại cho bạn mái tóc tươi mới nhẹ tênh và da đầu sạch thoáng không còn gàu. ',128000,'LSP005','TH0015',1),('SP0042','Dầu Gội Sạch Gàu CLEAR Nuôi Dưỡng Da Đầu Mát Lạnh Bạc Hà 630g','2020-11-19','2024-11-19','Dầu Gội Sạch Gàu CLEAR Nuôi Dưỡng Da Đầu đến từ thương hiệu dầu gội CLEAR thuộc tập đoàn UNILEVER, với công thức Gel đột phá hoàn toàn mới chứa gấp đôi sức mạnh, giúp thẩm thấu nhanh & sâu hơn, làm sạch gàu vượt trội đồng thời cấp ẩm cho da đầu và tóc.',120000,'LSP005','TH0015',18),('SP0043','Thực Phẩm Bảo Vệ Sức Khỏe InnerB Aqua Rich DoubleUp 56 Viên','2021-02-15','2024-02-15','Thực Phẩm Bảo Vệ Sức Khỏe InnerB Aqua Radiant Soft Skin là Thức Uống Hỗ Trợ Sức Khỏe & Làm Đẹp của thương hiệu Innerb (thuộc tập đoàn CJ) đến từ Hàn Quốc, được bào chế ở dạng viên uống giúp cấp nước, bổ sung độ ẩm cho da căng mượt, mịn màng, từ đó ngăn ngừa nếp nhăn và các dấu hiệu lão hóa, mang lại cho bạn làn da rạng rỡ và tươi trẻ',760000,'LSP006','TH0016',24),('SP0044','Nước Uống Collagen Innerb Làm Đẹp Da 6 Chai X 50ml','2020-10-25','2024-10-25','Nước Uống Collagen Làm Đẹp Da InnerB GlowShot Collagen 3000 là dòng sản phẩm thức uống hỗ trợ sức khỏe & làm đẹp của thương hiệu InnerB từ Hàn Quốc, chứa thành phần Collagen Peptide đậm đặc 3000mg, Elastin và Vitamin C giúp bổ sung dưỡng chất hỗ trợ cho làn da khỏe mạnh, đồng thời dưỡng da ẩm mượt, thúc đẩy quá trình tái tạo da, ngăn ngừa xuất hiện các dấu hiệu lão hóa, mang lại làn da mịn màng tươi sáng.',250000,'LSP006','TH0016',26),('SP0045','Viên Uống DHC Rau Củ Quả Tổng Hợp Premium 30 Ngày 120 Viên','2021-09-22','2025-09-22','Viên Uống Rau Củ Quả Tổng Hợp DHC Perfect Vegetable - Premium Japanese Harvest từ thương hiệu DHC là dòng thực phẩm chức năng hỗ trợ sức khỏe nổi tiếng của Nhật Bản. Trong mỗi viên DHC rau củ là tổng hợp 32 loại rau xanh, củ quả khác nhau giúp hỗ trợ bổ sung hàm lượng rau xanh, dành cho những người bận rộn, không có thời gian ăn uống đủ chất, hay những người ghét và lười ăn rau. Sử dụng viên uống DHC rau củ quả hỗ trợ làm đẹp da… Sản phẩm dạng viên uống giúp bạn dễ dàng mang theo khi đi làm hay đi du lịch.',260000,'LSP006','TH0017',17),('SP0046','Bột Uống Collagen Naris ITOH Dưỡng Sáng Da 2gX30 Gói','2020-11-29','2025-11-29','Bột Collagen Dưỡng Da Vị Xoài Naris Cosmetic Sapril Collagen là dòng sản phẩm collagen của thương hiệu Naris nổi tiếng ở Nhật Bản, rất được chị em phụ nữ ở Nhật Bản tin dùng.Sản phẩm giúp bổ sung hàm lượng collagen cần thiết cho cơ thể giúp hỗ trợ duy trì sự săn chắc, đàn hồi và khỏe mạnh cho làn da. Ngoài ra, sản phẩm còn hỗ trợ làm giảm các biểu hiện và giúp làm chậm tiến trình da lão hóa, giúp da sáng và ẩm mịn.',425000,'LSP006','TH0018',27),('SP0047','Nước Uống Collagen Nucos Spa Làm Sáng Da (10.000mg x 10)','2021-04-26','2024-04-26','Nước Uống Cung Cấp Collagen & Làm Sáng Da 9 Trong 1 NUCOS Spa Whitening & Skin Theraphy 9-in-1 Collagen Drink là sản phẩm của thương hiệu NUCOS đến từ Nhật Bản, giúp cung cấp hàm lượng Collagen cần thiết cho làn da cũng như cơ thể, mang lại cho làn da 9 công dụng tuyệt hảo, đồng thời kết hợp với khả năng nuôi dưỡng cho da trở nên sáng mịn rạng rỡ từ bên trong.',1690000,'LSP006','TH0019',5),('SP0048','Nước Ép Bưởi Sanga Hỗ Trợ Giảm Cân, Làm Đẹp Da 20g x 30 Gói','2020-12-27','2024-12-27','Nước Ép Sanga Hỗ Trợ Giảm Cân, Làm Đẹp Da Vita Tok Tok 20g x 30 Gói là thức uống hỗ trợ sức khỏe và làm đẹp đến từ thương hiệu Sanga của Hàn Quốc, chiết xuất từ hoa quả tự nhiên giúp hỗ trợ giảm cân an toàn, bổ sung nước, vitamin, khoáng chất thiết yếu, tăng sức đề kháng cho cơ thể, đặc biệt chứa nhiều thành phần vitamin C giúp hỗ trợ làm đẹp da và giảm bớt calo đem lại hiệu quả giảm cân rõ rệt. ',675000,'LSP006','TH0020',4),('SP0049','Viên Uống DHC Mầm Đậu Nành Gói 30 Ngày 60 Viên','2021-02-24','2025-02-24','Viên Uống Mầm Đậu Nành DHC Soy Isoflavone Absorption Type là một trong những loại thực phẩm chức năng hỗ trợ sức khỏe & làm đẹp từ thương hiệu DHC Nhật Bản, chứa thành phần Isoflavone chiết xuất từ mầm đậu nành giúp cân bằng nội tiết tố nữ, hỗ trợ cải thiện sinh lý cho phụ nữ độ tuổi trung niên, đồng thời chống oxy hóa, ngăn ngừa lão hóa và giúp da săn chắc khỏe đẹp.',500000,'LSP006','TH0017',20),('SP0050','Viên Uống Nucos Sáng Da, Giảm Nám, Chống Nắng 60 Viên','2020-11-23','2023-11-23','Viên Uống NUCOS Chống Nắng, Làm Sáng Da, Giảm Nám White Plus Placenta (60 Viên/Hộp) là sản phẩm thức uống hỗ trợ sức khỏe và làm đẹp đến từ thương hiệu mỹ phẩm Nucos của Nhật Bản, chiết xuất 100% thành phần từ thiên nhiên với công nghệ cải tiến vượt trội làm tăng hiệu quả dưỡng sáng, cải thiện tình trạng không đều màu, hạn chế tình trạng xuất hiện đốm nâu, nám, tàn nhang, đồi mồi, ngoài ra còn nâng cao khả năng chống nắng tự nhiên.',595000,'LSP006','TH0019',17);
